import card from "./card.module.css"

import React from 'react';
import {Router} from 'react-router-dom';

const Card = (pokemon) => {

    let id = pokemon.img.split('/')[pokemon.img.split('/').length - 2];
    let img = `https://github.com/PokeAPI/sprites/blob/master/sprites/pokemon/${id}.png?raw=true`;

    return(

            <div className="rounded-lg col-md- shadow p-2 border m-1">
                <div className={card.pakemon}>
                    <div className="image">
                        <img className={card.imgPokemon} src={img} alt={pokemon.name}/>
                    </div>
                    <div className="info">
                        <h2>
                            <img src={pokemon.sprites.front_efault} alt=""/>
                            <a href="#">
                                {pokemon.name}
                            </a>
                        </h2>
                        <p>#
                            {
                                id
                            }
                        </p>
                    </div>
                </div>
            </div>

    );
}

export default Card
